      /*  <h1>Course Detail{course_id}</h1>*/
      <div className="container mt-3">
        <div className="row">
             <div className="col-4">
                 <img src="/python.png" className="img-thumbnail" alt="..."/>
             </div>
             <div className="col-8">
                  <h1>Course Title</h1>
                  <p></p>
                  <p className="fw-bold">Course By:<a href='#'>Teacher 1</a></p>
                  <p className="fw-bold">Duration:<a href='#'>Teacher 1</a></p>
             </div>
        </div>
      </div>
    );
}
export default CourseDetail;
